import classes from "./AddUser.module.css";
import Button from "./Layouts/Button";

const AddUser = () => {
  return (
    <form className={classes.input}>
      <label>Username</label>
      <input></input>
      <label>App(years)</label>
      <input></input>
      <Button>Add User</Button>
    </form>
  );
};

export default AddUser;
